import React from "react";
import { UserIcon } from '@heroicons/react/24/outline';

const learnLanguages = [
    "Norsk",
    "Francais",
    "Italiano"
];

const useLanguages = [
    "English"
];

function Login() {
    return(
    <UserIcon className="absolute top-6 right-8 h-10 w-10 text-gray-600 cursor-pointer" />
    );
}

function DropDown(props) {
    return (
        <>
        <h1>{props.label}</h1>
        <select>
        {props.list.map((opt) => {
            return(
                <option key={opt}>{opt}</option>
            ) 
        })}
        </select>
        </>
    );
}
 
const Home = () => {
    return (
        <div className = "relative flex flex-col h-screen text-base  bg-blue-200 border-l">
            <Login />
            <DropDown label="Learn" list={learnLanguages} />
            <DropDown label="Using" list = {useLanguages} />
            <button>Launch Chatroom</button>
        </div>
    );
};
 
export default Home;
